def binary_search(list_, who):
    l = 0
    r = len(list_)
    while l<r:
        m = (l+r)//2
        if list_[m][0] == who:
            return list_[m][1]
        elif list_[m][0] < who:
            l = m + 1
        elif list_[m][0] > who:
            r = m
    return -1


